import imge from "../assets/imgs/הפוך-ליד-להזדמנות.png";
import Para from "./Para";

const Features = () => {
  return (
    <div className="features">
      <div className="right">
        <h1>מקסמו את פוטנציאל המכירה</h1>

        <Para />
        <Para />
        <Para />
      </div>
      <div className="left">
        <img src={imge} />
      </div>
    </div>
  );
};

export default Features;
